import React from "react";
import { Link } from "react-router-dom";
import "../Tripnest.css";

const Home = () => {
  return (
    <>
      {/* Hero Section */}
      <section
        className="tripnest-hero d-flex align-items-center text-white text-center"
        id="Home-page"
      >
        <div className="tripnest-hero-container container">
          <h2 className="fw-semibold text-uppercase mb-3 text-warning tripnest-subtitle">
            Welcome to TripNest
          </h2>
          <h1 className="fw-bold display-2 tripnest-title">
            It is Better to <br /> Travel Well
            <span className="text-primary"> Than</span> <br />
            <span className="text-primary"> to Arrive </span>
          </h1>

          <Link
            to="/booking"
            className="btn tripnest-btn-gradient rounded-pill px-5 py-3 mt-4 fs-5"
          >
            <i className="fa-solid fa-paper-plane me-2"></i> Start Your Journey
          </Link>
        </div>
      </section>
    </>
  );
};

export default Home;
